import React, {Component, useState,useContext} from 'react';
import ReactDOM from 'react-dom';
import {UserContext} from "../../providers/UserProvider";
import './navbar.css';
import logo from '../../img/logo.png';
import {Link} from 'react-router-dom';

const Navbar = (props) => {
  const user = useContext(UserContext);
  const {displayName,photoURL} = user || { displayName: "", photoURL: logo };
  const shouldSignIn =  <img src={photoURL} className="userPhoto" /> ;



  return(
    <div className="navbar flex flex-row justify-between bg-gray-600 w-full md:items-start table border-red-300">
      <div className="signinBox ml-6 my-5 h-12 w-12">
        { !user ? <Link to="/signin">
        <img src={photoURL} className="userPhoto w-full" />
        </Link>
        :
        <img src={photoURL} className="userPhoto w-full" />
      }
        <p> {user? user.displayName : "Welcome"} </p>
      </div>
      <div className="mx-5 hover:">
      <Link to="/about">  About </Link>
      </div>



    </div>
  )

};
export default Navbar;
